Big Tits at School - The Public Speaker

November 09, 2010

Rocco has to give a speech in front of the school for his public speaking class. He can't stand talking in front of an audience and is stressing out backstage. Loni, a playful girl, sees Rocco in distress. She tells him to try and picture the audience naked. Rocco takes Loni's advice and pictures her naked. After Rocco confesses his visions to Loni she gets pissed and does it to him for round two. When they confront each other after the speeches, Rocco and Loni want to confirm their visions on stage.

